import { createMuiTheme } from "@material-ui/core/styles";


const theme = createMuiTheme({
    palette: {
      primary: {
        main: "#DE7C78",
        contrastText: "#fff",
      },
    },
    typography: {
      fontFamily: [
        '-apple-system',
        'BlinkMacSystemFont',
        '"Segoe UI"',
        'Roboto',
        '"Helvetica Neue"',
        'Arial',
      ].join(','),
    },
  });

  export default theme
